// src/pages/Checkout.js
import React, { useEffect, useState } from "react";
import { Box, Typography, TextField, Button, MenuItem, Paper } from "@mui/material";
import { getCart } from "../api/cart";
import { placeOrder } from "../api/orders";
import { useNavigate } from "react-router-dom";

export default function Checkout() {
  const navigate = useNavigate();
  const username = localStorage.getItem("username");

  const [cart, setCart] = useState([]);
  const [name, setName] = useState(username || "");
  const [address, setAddress] = useState("");
  const [deliveryDate, setDeliveryDate] = useState(
    new Date().toISOString().split("T")[0]
  );
  const [deliverySlot, setDeliverySlot] = useState("Morning");

  // Redirect to login if not logged in
  useEffect(() => {
    if (!username) {
      alert("Please login first to place an order!");
      navigate("/login");
    }
  }, [username, navigate]);

  // Fetch cart items
  useEffect(() => {
    getCart()
      .then(res => setCart(res.data))
      .catch(console.error);
  }, []);

  const total = cart.reduce(
    (sum, it) => sum + (it.totalPrice ?? it.basePrice * (it.quantity || 1)),
    0
  );

  const handlePlaceOrder = () => {
    if (!name || !address) return alert("Please fill in your name and address.");

    const orderPayload = {
      userName: username,
      deliveryDate: new Date(deliveryDate),
      deliverySlot,
      items: cart.map(item => ({
        productId: item.productId,
        quantity: item.quantity,
        selectedSingle: JSON.stringify(item.selectedSingle || {}),
        selectedToppings: JSON.stringify(item.selectedToppings || []),
        totalPrice: item.totalPrice ?? item.basePrice * item.quantity
      }))
    };

    placeOrder(orderPayload)
      .then(() => {
        alert("Order placed successfully!");
        navigate("/orders"); // redirect to user's order history
      })
      .catch(console.error);
  };

  if (!cart.length)
    return <Typography sx={{ p: 3 }}>Your cart is empty.</Typography>;

  return (
    <Box sx={{ maxWidth: 600, mx: "auto", p: 3 }}>
      <Paper sx={{ p: 3 }}>
        <Typography variant="h4" sx={{ mb: 3, textAlign: "center" }}>
          Checkout
        </Typography>

        <TextField
          label="Name"
          fullWidth
          sx={{ mb: 2 }}
          value={name}
          onChange={e => setName(e.target.value)}
        />

        <TextField
          label="Address"
          fullWidth
          multiline
          rows={4}
          sx={{ mb: 2 }}
          value={address}
          onChange={e => setAddress(e.target.value)}
        />

        <TextField
          label="Delivery Date"
          type="date"
          fullWidth
          sx={{ mb: 2 }}
          InputLabelProps={{ shrink: true }}
          value={deliveryDate}
          onChange={e => setDeliveryDate(e.target.value)}
        />

        <TextField
          select
          label="Delivery Slot"
          fullWidth
          sx={{ mb: 2 }}
          value={deliverySlot}
          onChange={e => setDeliverySlot(e.target.value)}
        >
          <MenuItem value="Morning">Morning (8 AM - 12 PM)</MenuItem>
          <MenuItem value="Afternoon">Afternoon (12 PM - 4 PM)</MenuItem>
          <MenuItem value="Evening">Evening (4 PM - 8 PM)</MenuItem>
        </TextField>

        <Typography variant="h6" sx={{ mt: 2 }}>
          Total: â‚¹{total}
        </Typography>

        <Button
          variant="contained"
          color="primary"
          sx={{ mt: 3 }}
          fullWidth
          onClick={handlePlaceOrder}
        >
          Place Order
        </Button>
      </Paper>
    </Box>
  );
}
